import React, { useState } from 'react';
import { Filter, Download } from 'lucide-react';
import { mockTransactions } from '../utils/mockData';

const Transactions = () => {
  const [filter, setFilter] = useState('ALL');
  const [dateFilter, setDateFilter] = useState('ALL');

  const filteredTransactions = mockTransactions.filter(transaction => {
    if (filter !== 'ALL' && transaction.type !== filter) return false;
    return true;
  });

  const getStatusBadge = (status) => {
    const baseClasses = "inline-block px-2 py-1 text-xs font-medium rounded-full";
    switch (status) {
      case 'Completed':
        return `${baseClasses} bg-success-50 text-success-600`;
      case 'Pending':
        return `${baseClasses} bg-yellow-50 text-yellow-600`;
      case 'Failed':
        return `${baseClasses} bg-danger-50 text-danger-600`;
      default:
        return `${baseClasses} bg-gray-50 text-gray-600`;
    }
  };

  const getTypeBadge = (type) => {
    const baseClasses = "inline-block px-2 py-1 text-xs font-medium rounded-full";
    return type === 'BUY' 
      ? `${baseClasses} bg-success-50 text-success-600`
      : `${baseClasses} bg-danger-50 text-danger-600`;
  };

  return (
    <div className="space-y-6">
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Transactions</h1>
          <p className="text-gray-600">View your complete trading history</p>
        </div>
        <button className="flex items-center px-4 py-2 bg-primary-600 text-white rounded-lg hover:bg-primary-700">
          <Download className="h-4 w-4 mr-2" />
          Export
        </button>
      </div>

      {/* Filters */}
      <div className="card">
        <div className="flex flex-wrap items-center gap-4">
          <div className="flex items-center space-x-2">
            <Filter className="h-4 w-4 text-gray-500" />
            <span className="text-sm font-medium text-gray-700">Filters:</span>
          </div>

          <select 
            value={filter} 
            onChange={(e) => setFilter(e.target.value)}
            className="border border-gray-300 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-primary-500"
          >
            <option value="ALL">All Types</option>
            <option value="BUY">Buy Only</option>
            <option value="SELL">Sell Only</option>
          </select>

          <select 
            value={dateFilter} 
            onChange={(e) => setDateFilter(e.target.value)}
            className="border border-gray-300 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-primary-500"
          >
            <option value="ALL">All Time</option>
            <option value="TODAY">Today</option>
            <option value="WEEK">This Week</option>
            <option value="MONTH">This Month</option>
          </select>
        </div>
      </div>

      {/* Transactions Table */}
      <div className="card">
        <div className="overflow-x-auto">
          <table className="min-w-full">
            <thead>
              <tr className="border-b border-gray-200">
                <th className="text-left py-3 px-4 font-medium text-gray-900">Date</th>
                <th className="text-left py-3 px-4 font-medium text-gray-900">Asset</th>
                <th className="text-center py-3 px-4 font-medium text-gray-900">Type</th>
                <th className="text-right py-3 px-4 font-medium text-gray-900">Quantity</th>
                <th className="text-right py-3 px-4 font-medium text-gray-900">Price</th>
                <th className="text-right py-3 px-4 font-medium text-gray-900">Total</th>
                <th className="text-center py-3 px-4 font-medium text-gray-900">Status</th>
              </tr>
            </thead>
            <tbody>
              {filteredTransactions.map((transaction) => (
                <tr key={transaction.id} className="border-b border-gray-100 hover:bg-gray-50">
                  <td className="py-4 px-4 text-gray-900">
                    {new Date(transaction.date).toLocaleDateString('en-IN', {
                      day: '2-digit',
                      month: 'short',
                      year: 'numeric'
                    })}
                  </td>
                  <td className="py-4 px-4">
                    <div>
                      <p className="font-medium text-gray-900">{transaction.symbol}</p>
                    </div>
                  </td>
                  <td className="py-4 px-4 text-center">
                    <span className={getTypeBadge(transaction.type)}>
                      {transaction.type}
                    </span>
                  </td>
                  <td className="text-right py-4 px-4 text-gray-900">{transaction.quantity}</td>
                  <td className="text-right py-4 px-4 text-gray-900">₹{transaction.price}</td>
                  <td className="text-right py-4 px-4 font-medium text-gray-900">
                    ₹{(transaction.quantity * transaction.price).toLocaleString()}
                  </td>
                  <td className="py-4 px-4 text-center">
                    <span className={getStatusBadge(transaction.status)}>
                      {transaction.status}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {filteredTransactions.length === 0 && (
          <div className="text-center py-8">
            <p className="text-gray-500">No transactions found matching your filters.</p>
          </div>
        )}
      </div>

      {/* Transaction Summary */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="card text-center">
          <p className="text-sm text-gray-600">Total Transactions</p>
          <p className="text-2xl font-bold text-gray-900">{mockTransactions.length}</p>
        </div>
        <div className="card text-center">
          <p className="text-sm text-gray-600">Total Buy Orders</p>
          <p className="text-2xl font-bold text-success-600">
            {mockTransactions.filter(t => t.type === 'BUY').length}
          </p>
        </div>
        <div className="card text-center">
          <p className="text-sm text-gray-600">Total Sell Orders</p>
          <p className="text-2xl font-bold text-danger-600">
            {mockTransactions.filter(t => t.type === 'SELL').length}
          </p>
        </div>
      </div>
    </div>
  );
};

export default Transactions;
